const GAME_STATE = {
    BEFORE: 'before',
    IN_PROGRESS: 'in_progress',
    ENDED: 'ended',
    SHOW_LEADERBOARD: 'show_leaderBoard',
    ADD_LEADERBOARD: 'add_leaderBoard'
}
export {GAME_STATE};
